column17:
The following posts use a distract tactic by introducing an irrelevant topic:

@bitcoinlfgo As per #CZ bullrun will start from china and #OggyInu is focusing there do you got the connection? @OggyInuBrand üëä

This post introduces the topic of the OggyInu cryptocurrency, which is unrelated to the discussion of international relations and the potential bullrun starting from China. This distracts from the main topic at hand.

@papa_woody21 @MissDCflowers As per #CZ bullrun will start from china and #OggyInu is focusing there do you got the connection? @OggyInuBrand üëä

Similar to the previous post, this tweet introduces the topic of the OggyInu cryptocurrency, which is unrelated to the main discussion of international relations. This serves as a distraction from the main topic of conversation.

column8:
1. Appeal to Popularity: This fallacy occurs when someone argues that a claim must be true because it is widely believed or accepted. In this case, the repeated use of the hashtag #RM for #ArtistaAsiatico at #SECAwards with different variations of the same message suggests an attempt to manipulate perception by making it seem like many people are voting for the same choice, therefore making it more credible. This can be seen in the following post: 
@knj_brasil @demonarmys @secawards I vote #RM for #ArtistaAsiatico at #SECAwards Marcos

2. Bandwagon: The bandwagon fallacy is similar to the appeal to popularity, but it specifically appeals to the idea that because something is popular or widely accepted, it must therefore be the correct choice. This can be seen in the following post:
@demonarmys @secawards I vote #RM for #ArtistaAsiatico at #SECAwards Marcos

3. Name Calling: This fallacy involves attacking the person making an argument rather than addressing the argument itself. In this case, the use of the name "Marcos" in multiple posts could potentially be a form of name-calling or attempting to discredit the individual by repeatedly associating them with a particular choice. This can be seen in the following post: 
@JJK_lirio @secawards I vote #RM for #ArtistaAsiatico at #SECAwards marcos

4. Appeal to Tradition: This fallacy occurs when someone argues that a claim must be true or correct because it has been believed or followed for a long time. The use of the hashtag #ArtistaAsiatico at the 2023 #SECAwards could be interpreted as an attempt to leverage tradition or the longevity of the event to influence the voting outcome. This can be seen in the following post:
@knj_brasil @secawards I vote #RM for #ArtistaAsiatico at the 2023 #SECAwards Marcos

column15:
The post that uses a Distort tactic is: 
@knj_brasil @secawards I vote #RM for #ArtistaAsiatico at the 2023 #SECAwards Marcos

This tweet alters the main message of the topic by including the year "2023" for the awards, which is not relevant to the original message about international relations.
